import React from 'react';
import BookShelf from './BookShelf';


const Landing = () => {
    return (
        <div className="px-6 px-5">
            <body className="justify-center mt-10 max-w-7xl sm:mt-12 sm:px-6 md:mt-16 lg:mt-20 lg:px-8 xl:mt-28">
                <div className="sm:text-center lg:text-left flex overflow-x-scroll overflow-x-auto">
                    <h2 className="text-bold text-center">Choose Your Story!</h2>
                    <BookShelf />
                </div>
            </body>
            <br/>
        </div>
    );
};

export default Landing;
